import React from 'react';
import PropTypes from 'prop-types';

// Components
import Tile from '../Tile';

// Styling
import { Box, Flex, Text } from '../../styles';

const Tiles = ({ items }) => (
  <Flex>
    {items?.map(item => (
      <Tile />
    ))}
  </Flex>
);

Tiles.propTypes = {
  items: PropTypes.arrayOf(PropTypes.object).isRequired,
};

export default Tiles;
